import React, {Component} from 'react'

export default class Header extends Component{
    render(){
        return(
            <div class="ui menu">
  <a class="item active">Browse</a>
  <a class="item">Submit</a>
  <div class="right menu">
    <a class="item">Sign Up</a>
    <a class="item">Help</a>
  </div>
</div>
        )
    }

}
